INSERT INTO `yii_article` (`id`, `pid`, `title`, `keywords`, `description`, `content`, `is_show`, `uptime`, `addtime`) VALUES
(1, 5, 'mysql 索引创建,删除,重建,查看', 'mysql 索引操作', '', '<p style="white-space: normal; color: rgb(68, 68, 68); font-family: &quot;Courier New&quot;, Courier, monospace; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(220, 220, 220);"><strong>1、创建索引</strong>（PRIMARY KEY，INDEX，UNIQUE）<br/><span style="color: rgb(0, 0, 255);">mysql&gt;ALTER TABLE tbl_name ADD INDEX index_name (column list);<br/>mysql&gt;ALTER TABLE tbl_name ADD UNIQUE index_name (column list);<br/>mysql&gt;ALTER TABLE tbl_name ADD PRIMARY KEY index_name (column list);<br/></span></p><p style="white-space: normal; color: rgb(68, 68, 68); font-family: &quot;Courier New&quot;, Courier, monospace; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(220, 220, 220);"><strong>2、删除索引</strong>（PRIMARY KEY，INDEX，UNIQUE）<br/><span style="color: rgb(0, 0, 255);">mysql&gt;ALTER TABLE tbl_name DROP INDEX index_name (column list);<br/>mysql&gt;ALTER TABLE tbl_name DROP UNIQUE index_name (column list);<br/>mysql&gt;ALTER TABLE tbl_name DROP PRIMARY KEY index_name (column list);<br/></span></p><p style="white-space: normal; color: rgb(68, 68, 68); font-family: &quot;Courier New&quot;, Courier, monospace; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(220, 220, 220);"><strong>3、重建索引</strong><br/><span style="color: rgb(0, 0, 255);">mysql&gt; REPAIR TABLE tbl_name QUICK;</span><br/>&nbsp;</p><p style="white-space: normal; color: rgb(68, 68, 68); font-family: &quot;Courier New&quot;, Courier, monospace; font-size: 14px; line-height: 25px; widows: 1; background-color: rgb(220, 220, 220);"><strong>4、查看某个数据表的索引<br/></strong><span style="color: rgb(0, 0, 255);">mysql&gt; SHOW INDEX FROM tbl_name;</span></p><p><span style="color: rgb(0, 0, 255);"><br/></span></p><p><br/></p>', 1, 1476283536, 1476283489),
(2, 5, 'mysql 添加索引 mysql 如何创建索引', '', '', '<p>1.添加PRIMARY KEY（主键索引） <br/>mysql&gt;ALTER TABLE `table_name` ADD PRIMARY KEY ( \r\n`column` ) <br/>2.添加UNIQUE(唯一索引) <br/>mysql&gt;ALTER TABLE `table_name` ADD UNIQUE \r\n( <br/>`column` <br/>) <br/>3.添加INDEX(普通索引) <br/>mysql&gt;ALTER TABLE `table_name` \r\nADD INDEX index_name ( `column` ) <br/>4.添加FULLTEXT(全文索引) <br/>mysql&gt;ALTER \r\nTABLE `table_name` ADD FULLTEXT ( `column`) <br/>5.添加多列索引 <br/>mysql&gt;ALTER \r\nTABLE `table_name` ADD INDEX index_name ( `column1`, `column2`, `column3` )</p><p><strong>下面是更加详细的方法</strong></p><p>MySQL中可以使用alter table这个SQL语句来为表中的字段添加索引。<br/><br/>使用alter \r\ntable语句来为表中的字段添加索引的基本语法是：<br/>ALTER TABLE &lt;表名&gt; ADD INDEX \r\n(&lt;字段&gt;);<br/><br/>我们来尝试为test中t_name字段添加一个索引。<br/><br/>mysql&gt;<span style="COLOR: #ff0000"> alter table test add index(t_name);<br/></span>Query OK, \r\n0 rows affected (0.17 sec)<br/>Records: 0&nbsp; Duplicates: 0&nbsp; Warnings: \r\n0<br/><br/>执行成功后，我们来看看结果。<br/><br/>mysql&gt; describe \r\ntest;<br/>+------------+-------------+------+-----+---------+-------+<br/>| \r\nField&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; | Type&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; | Null | Key | Default | Extra \r\n|<br/>+------------+-------------+------+-----+---------+-------+<br/>| t_id&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\n| int(11)&nbsp;&nbsp;&nbsp;&nbsp; | YES&nbsp; |&nbsp;&nbsp;&nbsp;&nbsp; | NULL&nbsp;&nbsp;&nbsp; |&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; |<br/>| t_name&nbsp;&nbsp;&nbsp;&nbsp; | varchar(50) | \r\nNO&nbsp;&nbsp; | MUL | NULL&nbsp;&nbsp;&nbsp; |&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; |<br/>| t_password | char(32)&nbsp;&nbsp;&nbsp; | YES&nbsp; |&nbsp;&nbsp;&nbsp;&nbsp; | \r\nNULL&nbsp;&nbsp;&nbsp; |&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; |<br/>| t_birth&nbsp;&nbsp;&nbsp; | date&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; | YES&nbsp; |&nbsp;&nbsp;&nbsp;&nbsp; | NULL&nbsp;&nbsp;&nbsp; |&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\n|<br/>+------------+-------------+------+-----+---------+-------+<br/>4 rows in \r\nset (0.00 \r\nsec)<br/><br/>结果可以看出，t_name字段的Key这一栏由原来的空白变成了MUL。这个MUL是什么意思呢？简单解释一下：如果Key是MUL，那么该列的值可以重复，该列是一个非唯一索引的前导列(第一列)或者是一个唯一性索引的组成部分但是可以含有空值NULL。<br/></p><p><br/></p>', 1, 1476283989, 1476283989),
(3, 5, ' mysql 添加字段、删除字段、调整字段顺序', '', '', '<p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"><strong>添加字段</strong>：<br/>alter table 表名<br/>Add column 字段名 字段类型&nbsp; 默认值 AFTER 字段名 (在哪个字段后面添加)</span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;">例子：<br/>alter table appstore_souapp_app_androidmarket<br/>Add column getPriceCurrency varchar(50)&nbsp;&nbsp; default null AFTER getPrice</span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"><strong>修改字段</strong>：<br/>alter table表名<br/>change 字段名 新字段名 字段类型 默认值</span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;">例子：<br/>alter table appstore_souapp_app_androidmarket change hasPrice hasPrice varchar(10)&nbsp; null;</span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><pre id="best-content-1869307178" accuse="aContent">使用ALTER命令修改字段类型，格式：\r\nALTER&nbsp;TABLE&nbsp;表名&nbsp;&nbsp;MODIFY&nbsp;COLUMN&nbsp;字段名&nbsp;字段类型定义;\r\n\r\n例如：\r\nALTER&nbsp;TABLE&nbsp;chatter_users&nbsp;&nbsp;MODIFY&nbsp;COLUMN&nbsp;ip&nbsp;VARCHAR(50);</pre><p><span style="font-size: x-small;"></span><br/></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"><strong>删除字段</strong>：<br/>alter table 表名 drop column 字段名</span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;">例子：<br/>alter table appstore_souapp_app_androidmarket<br/>drop column getPriceCurrency</span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"><strong>调整字段顺序</strong>：<br/>alter table 表名<br/>change 字段名 新字段名 字段类型 默认值 after 字段名(跳到哪个字段之后)</span></p><p style="color: rgb(51, 51, 51); font-family: Arial; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: 11px;"><strong><span style="font-size:10px">修改字段顺序</span></strong></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p>ALTER TABLE `hn_user`</p><p>MODIFY COLUMN `region` &nbsp;int(3) NOT NULL COMMENT &#39;会员所属分类&#39; AFTER `password`;</p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span><br/></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;"></span></p><p style="color: rgb(51, 51, 51); font-family: Arial; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: x-small;">例子：<br/>alter table appstore_souapp_app_androidmarket<br/>change getPriceCurrency getPriceCurrency varchar(50)&nbsp;&nbsp; default null AFTER getPrice</span></p><p><br/></p>', 1, 1487754421, 1477756220),
(4, 5, 'yii2缓存的使用', '', '', '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">一个好的框架是肯定离不开缓存的使用，相反，一个没有缓存的框架也肯定不是一个好框架，好像是一个意思，不管了，我们先来看看yii2中是如何使用缓存的吧。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">又是到我们第一步操作的时候了，我们先来配置组件。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">方便起见，我们的缓存组件配置在common\\config\\main.php文件，先来简单配置下文件缓存</p><pre class="brush:php;">&#39;components&#39;&nbsp;=&gt;&nbsp;[&nbsp;\r\n&#39;cache&#39;&nbsp;=&gt;&nbsp;[&nbsp;\r\n&#39;class&#39;&nbsp;=&gt;&nbsp;&#39;yii\\caching\\FileCache&#39;,&nbsp;\r\n&#39;cachePath&#39;&nbsp;=&gt;&nbsp;&#39;@runtime/cache2&#39;,&nbsp;\r\n],&nbsp;\r\n],</pre><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">所谓的文件缓存，其实就是把我们要缓存的数据存放到文件内，那数据又缓存到哪里了呢？</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">//默认的缓存路径是@app\\runtime\\cache目录下，如果你想要修改缓存路径，可以像上面配置一样，配置下cachePath即可</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">我们直接来操作看看</p><pre class="brush:php;">$cache&nbsp;=&nbsp;Yii::$app-&gt;cache;&nbsp;\r\n$data&nbsp;=&nbsp;$cache-&gt;get(&#39;cache_data_key&#39;);&nbsp;\r\nif&nbsp;($data&nbsp;===&nbsp;false)&nbsp;{&nbsp;\r\n//这里我们可以操作数据库获取数据，然后通过$cache-&gt;set方法进行缓存&nbsp;\r\n$cacheData&nbsp;=&nbsp;......&nbsp;\r\n//set方法的第一个参数是我们的数据对应的key值，方便我们获取到&nbsp;\r\n//第二个参数即是我们要缓存的数据&nbsp;\r\n//第三个参数是缓存时间，如果是0，意味着永久缓存。默认是0&nbsp;\r\n$cache-&gt;set(&#39;cache_data_key&#39;,&nbsp;$cacheData,&nbsp;60*60);&nbsp;\r\n}&nbsp;\r\nvar_dump($data);</pre><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">以上内容是小编给大家介绍的Yii2缓存的使用方法，大家可以参考下。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);"><strong>下面给大家介绍Yii设置Cache缓存的方法</strong></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">先在配置文件components数组中加上：</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);"><br/></p><p><span style="text-decoration:underline;">复制代码</span>&nbsp;代码如下:</p><p><br/>&#39;cache&#39;=&gt;array( &#39;class&#39;=&gt;&#39;CFileCache&#39;),<br/></p><p><br style="color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);"><br/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);"><strong>设置Cache：</strong></p><pre class="brush:php;">Yii::app()-&gt;cache-&gt;set(&#39;testcache&#39;,&nbsp;array(1,3,4,6));//默认有效期为一年\r\nYii::app()-&gt;cache-&gt;set(&#39;testcache&#39;,&nbsp;array(1,3,4,6),&nbsp;3600);//一个钟，秒为单位</pre><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);"><strong>获取Cache：</strong></p><pre class="brush:php;">$data&nbsp;=&nbsp;Yii::app()-&gt;cache-&gt;get(&#39;testcache&#39;);</pre><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);"><strong>删除单个Cache：</strong></p><pre class="brush:php;">Yii::app()-&gt;cache-&gt;delete(&#39;testcache&#39;);</pre><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; list-style: none; color: rgb(17, 17, 17); font-family: 宋体, 微软雅黑, Verdana, Helvetica; font-size: 14px; line-height: 25px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);"><strong>清空全部Cache：</strong></p><pre class="brush:php;">Yii::app()-&gt;cache-&gt;flush();</pre><p><br/></p>', 1, 1482135015, 1482135015),
